	add("astatine", "{\"term\":\"astatine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄστατος\u0027 (unstable) {{suffix||ine|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A highly radioactive chemical element (\u0027symbol\u0027 At), one of the halogens, with atomic number 85\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA, p. 221\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Astatine\u0027\u0027, for instance, is practically unstudied. It has a name and a place on the periodic table (next to Marie Curie\u0027s polonium), but almost nothing else\", \"priority\":3}]}, \"synonyms\":{}}");

	add("aster", "{\"term\":\"aster\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027aster\u0027 from Ancient greek (to 1453) \u0027ἀστήρ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A star\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.94\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"by the changes and enter-caprings of which, the revolutions, motions, cadences, and carrols of the \u0027\u0027asters\u0027\u0027 and planets are caused and transported\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of several plants of the genus \u0027Aster\u0027; one of its flowers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, \u0027\u0027, Penguin 2011, p.120\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"On a sunny September morning, with the trees still green, but the \u0027\u0027asters\u0027\u0027 and fleabanes already taking over in ditch and dalk, Van set out for Ladoga, N.A\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A star-shaped structure formed during the mitosis of a cell\", \"priority\":7}]}, \"synonyms\":{}}");

