	add("asterisk", "{\"term\":\"asterisk\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 from Ancient greek (to 1453) \u0027ἀστερίσκος\u0027 (a little star, asterisk, used in manuscripts to mark passages) diminutive of \u0027ἀστήρ\u0027 (a star)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Symbol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A blemish in an otherwise outstanding achievement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They came into the tournament highly ranked, but with a little bit of an asterisk as their last two wins had been unconvincing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Alternate of Asteriscus\", \"priority\":4}]}, \"synonyms\":{}}");

	add("asterism", "{\"term\":\"asterism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀστερισμός\u0027 (group of stars) from \u0027ἀστήρ\u0027 (star)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small group of stars that forms a visible pattern but is not an official constellation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Big Dipper, Summer Triangle, and Orion\u0027s Belt are \u0027\u0027asterisms\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rarely used typographical symbol (⁂, three asterisks arranged in a triangle), used to call attention to a passage or to separate subchapters in a book\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A star-shaped figure exhibited by some crystals by reflected light (as in a star sapphire) or by transmitted light (as in some mica\", \"priority\":4}]}, \"synonyms\":{}}");

	add("asteroid", "{\"term\":\"asteroid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|grc|ἀστεροειδής|lang\u003den}}, from \u0027ἀστήρ\u0027 (star) + \u0027εἶδος\u0027 (form)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A naturally occurring solid object, which is smaller than a planet and is not a comet, that orbits a sta\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the Solar system, such a body that orbits within the orbit of Jupite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any member of the taxonomic class Asteroidea; a starfish\", \"priority\":3}]}, \"synonyms\":{}}");

