	add("asthenopia", "{\"term\":\"asthenopia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|asthenia|gloss1\u003dloss of strength|opia|gloss2\u003drelating to the eyes|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ophthalmological condition that manifests itself through nonspecific symptoms such as fatigue, red eyes, eye strain, pain in or around the eyes, blurred vision, headache and occasional double vision\", \"priority\":1}]}, \"synonyms\":{}}");

	add("asthenospermia", "{\"term\":\"asthenospermia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From astheno- + sperm + -ia\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Loss or reduction in the strength or energy of sperm cells, hence infertility. Not always infertile many are subfertile\", \"priority\":1}]}, \"synonyms\":{}}");

	add("asthenosphere", "{\"term\":\"asthenosphere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀσθενής\u0027 (weak) + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The zone of the Earth\u0027s upper mantle, below the lithosphere\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA, p. 192\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To say that the lithosphere floats on top of the \u0027\u0027asthenosphere\u0027\u0027 suggests a degree of easy buoyancy that isn\u0027t quite right\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 79\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027asthenosphere\u0027\u0027 that underlies the surface plates is not liquid in any vernacular sense, although it \u0027is\u0027 relatively plastic\", \"priority\":5}]}, \"synonyms\":{}}");

	add("asthma", "{\"term\":\"asthma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|grc|ἄσθμα||laborious breathing|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long-term respiratory condition, in which the airways may unexpectedly and suddenly narrow, often in response to an allergen, cold air, exercise, or emotional stress. Symptoms include wheezing, shortness of breath, chest tightness, and coughing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, William Golding, \u0027Lord of the Flies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;He kind of spat,\u0026quot; said Piggy. \u0026quot;My auntie wouldn\u0027t let me blow on account of my \u0027\u0027asthma\u0027\u0027. He said you blew from down here.\u0026quot; Piggy laid a hand on his jutting abdomen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/science-and-technology/21580133-how-microbes-promote-liver-cancer-overweight-punch-gut A punch in the passage\u003dMostly, the microbiome is beneficial. It helps with digestion and enables people to extract a lot more calories from their food than would otherwise be possible. Research over the past few years, however, has implicated it in diseases from atherosclerosis to \u0027\u0027asthma\u0027\u0027 to autism\", \"priority\":4}]}, \"synonyms\":{}}");

	add("astigmatism", "{\"term\":\"astigmatism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{prefix|a||t1\u003dnot|lang\u003den}} stem of Ancient greek (to 1453) \u0027lang\u003dgrc|στίγμα\u0027 () {{suffix||ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A defect of a lens such that light rays coming from a point do not meet at a focal point so that the image is blurred\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A disorder of the vision, usually due to a misshapen cornea, such that light does not focus correctly on the retina causing a blurred image\", \"priority\":2}]}, \"synonyms\":{}}");

	add("astika", "{\"term\":\"astika\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027sc\u003ddeva|आस्तिक|tr\u003dāstika\u0027 (orthodox, believing, pious, faithful) from \u0027sc\u003ddeva|अस्ति|tr\u003dasti\u0027 (\u0026quot;is, exists\u0026quot;, believing, pious)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Technical term in Hinduism used to classify philosophical schools and persons, according to whether they accept the authority of the Vedas as supreme revealed scriptures, or not\", \"priority\":1}]}, \"synonyms\":{}}");

