	add("astragalomancy", "{\"term\":\"astragalomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"* Ancient greek (to 1453) \u0027astragalos\u0027, one of the vertebrae.* Ancient greek (to 1453) \u0027astragaloi\u0027 (plural), a type of dice made from the knuckle bones of sheep.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by dice made from huckle-bones. They have four flat sides and two round sides which were marked\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Divination by throwing astragaloi \u0027(see etymology above)\u0027 onto the pages of a picture book\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Simply divination by dice\", \"priority\":3}]}, \"synonyms\":{}}");

