	add("astrobleme", "{\"term\":\"astrobleme\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"1963, from {{prefix|astro|lang\u003den}} Ancient greek (to 1453) \u0027βλῆμα\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pit-like structure created by an impacting meteoroid, asteroid or comet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("astrodome", "{\"term\":\"astrodome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|astro|dome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transparent dome in the fuselage of an aircraft or spacecraft through which navigational observations may be made\", \"priority\":1}]}, \"synonyms\":{}}");

