	add("astrology", "{\"term\":\"astrology\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027astrologie\u0027 and its source, Latin \u0027astrologia\u0027 (astronomy) from Ancient greek (to 1453) \u0027ἀστρολογία\u0027 (telling of the stars) from \u0027ἄστρον\u0027 (star, planet, or constellation) + \u0027-λογία\u0027 (treating of) combination form of \u0027-λόγος\u0027 (one who speaks (in a certain manner)) Morphologically {{confix|astro|logy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination about human affairs or natural phenomena from the relative positions of celestial celestial bodies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1390\u0027\u0027, \u0027Canterbury Tales\u0027, Harleian manuscript\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a pore scoler / had lerned art but al his fantasye / was torned for to lerne \u0027\u0027astrologye\u0027\u0027 […\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 274\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"For if astronomy is the study of the movements of the heavens, then \u0027\u0027astrology\u0027\u0027 is the study of the effects of those movements\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027The Guardian\u0027, (headline), 7 Feb 2012\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Followers of pseudosciences such as \u0027\u0027astrology\u0027\u0027 often draw spurious parallels between their beliefs and established science\", \"priority\":7}]}, \"synonyms\":{}}");

	add("astromancy", "{\"term\":\"astromancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{confix|astro|mancy|lang\u003den}}. From Latin \u0027astromantīa\u0027 from Ancient greek (to 1453) \u0027ἀστροµαντεία\u0027 from \u0027ἄστρον\u0027 (star) + \u0027μαντεία\u0027 (divination)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by the stars; astrology in its modern prophetic aspect\", \"priority\":1}]}, \"synonyms\":{}}");

